  var isARMprod = item.t && item.t.indexOf("ARM") > -1;
  var isRenoProd = item.cat && item.cat.indexOf("reno") > -1;
  if (isConv && fico > 740 && sp.fico740 !== 0 && !isHBprod && !isARMprod && !isRenoProd) { adj += sp.fico740; bd.push({l:"FICO740",v:sp.fico740}); }
  if (F.escrow && isConv) { var ev = (F.state === "CA" || F.state === "NY") ? misc.escCANY : misc.escOther; if (ev !== 0) { adj += ev; bd.push({l:"Escrow",v:ev}); } }
  return {adj:adj, final:base+adj, bd:bd, waived:waive};
}

function getResults() {
  var loanAmt = parseFloat(F.loanAmt) || 0;
  var results = [];
  for (var i = 0; i < rates.length; i++) {
    var item = rates[i];
    if (!item || !item.cat) continue;
    if (F.purpose === "purchase" && item.refi) continue;
    // Co-Op filter: only show Co-Op products when property type is coop
    var isCoop = item.p === "Co-Op";
    if (isCoop && F.prop !== "coop") continue;
    if (!isCoop && F.prop === "coop") continue;
    var isAmi = item.cat.indexOf("-ami") > -1 || item.p === "HomePoss" || item.p === "HomeReady" || item.p === "HR ARM";
    if (isAmi && (!F.incomeLevel || F.incomeLevel !== "low")) continue;
    var isRefiProd = item.p === "Refi Now" || item.p === "Refi Poss";
    if (isRefiProd && (F.purpose !== "rateterm" || !F.incomeLevel || (F.incomeLevel !== "low" && F.incomeLevel !== "mid100"))) continue;
    if (F.prodFilter !== "all" && item.p !== F.prodFilter) continue;
    if (F.catFilter !== "all") {
      if (F.catFilter === "govt" && item.cat.indexOf("govt") === -1) continue;
      if (F.catFilter === "conv") {
        var isConvHB = item.cat.indexOf("hb") > -1 && item.cat.indexOf("govt") === -1;
        var isConvReg = item.cat.indexOf("conv") > -1;
        if (!isConvReg && !isConvHB) continue;
      }
      if (F.catFilter === "hb" && (item.cat.indexOf("hb") === -1 || item.cat.indexOf("govt") > -1)) continue;
      if (F.catFilter === "reno" && item.cat.indexOf("reno") === -1) continue;
      if (F.catFilter === "nqm" && item.cat.indexOf("nqm") === -1) continue;
    }
    if (F.termFilter !== "all" && item.t !== F.termFilter) continue;
    if (loanAmt > 0 && F.fips) {
      var base = BASELINE[parseInt(F.units) || 1];
      var limit = getCountyLimit(F.fips, F.units);
      if (item.cat.indexOf("hb") > -1 && loanAmt <= base) continue;
      if (item.cat.indexOf("hb") === -1 && item.cat.indexOf("conv") > -1 && loanAmt > base && loanAmt <= limit) continue;
      if (loanAmt > limit && (item.cat.indexOf("conv") > -1 || item.cat.indexOf("hb") > -1)) continue;
    }
    var basePrice = item["l" + F.lock] || item.l30;
    var calc = calcAdj(basePrice, item);
    var afterComp = calc.final - F.comp;
    var disc = loanAmt > 0 ? (100 - afterComp) * loanAmt / 100 : 0;
    var months = item.t === "15Y" ? 180 : 360;
    var mr = item.r / 100 / 12;
    var mo = loanAmt > 0 ? (loanAmt * mr * Math.pow(1 + mr, months)) / (Math.pow(1 + mr, months) - 1) : 0;
    var total = disc + (mo * months - loanAmt);
    results.push({p:item.p, t:item.t, cat:item.cat, r:item.r, base:basePrice, calc:calc, afterComp:afterComp, disc:disc, mo:mo, total:total});
  }
  results.sort(function(a,b){return a.total - b.total;});
  return results;
}

function doZip(zip) {
  F.zip = zip; F.incomeLevel = ""; amiData = null;
  if (zip.length === 5 && /^[0-9]{5}$/.test(zip) && zipLookup[zip]) {
    var fips = zipLookup[zip];
    if (allCounties[fips]) {
      F.state = allCounties[fips][1]; F.county = allCounties[fips][0]; F.fips = fips;
      if (amiLookup[fips]) amiData = amiLookup[fips];
    }
  } else { F.state = ""; F.county = ""; F.fips = ""; }
  render();
}

function doPrice(v) {
  F.price = v;
  if (v && F.ltv) F.loanAmt = Math.round(parseFloat(v) * parseFloat(F.ltv) / 100);
  else if (v && F.loanAmt && !F.ltv) F.ltv = Math.round(parseFloat(F.loanAmt) / parseFloat(v) * 10000) / 100;
  render();
}

function doLtv(v) {
  F.ltv = v;
  if (v && F.price) F.loanAmt = Math.round(parseFloat(F.price) * parseFloat(v) / 100);
  render();
}

function render() {
  var filtered = getResults();
  var loanAmt = parseFloat(F.loanAmt) || 0;
  var limit = F.fips ? getCountyLimit(F.fips, F.units) : BASELINE[parseInt(F.units) || 1];
  var hb = F.fips ? isHighBalance(loanAmt, F.fips, F.units) : false;
  var jumbo = F.fips && loanAmt > limit;
  var best = filtered.length > 0 && loanAmt ? filtered[0] : null;
  
  var h = "";
  
  h += '<div class="bg-white rounded-lg shadow-lg p-4 mb-4">';
  h += '<h1 class="text-xl font-bold text-indigo-800">TPO Go Rate Calculator</h1>';
  h += '<p class="text-sm text-gray-600">Effective: ' + effectiveDate + '</p>';
  if (F.fips) {
    h += '<p class="text-xs mt-1">' + F.county + ', ' + F.state + ' | Limit: $' + limit.toLocaleString();
    if (jumbo) h += ' | <span class="text-red-600 font-bold">JUMBO</span>';
    else if (hb) h += ' | <span class="text-purple-600 font-bold">HIGH BALANCE</span>';
    else h += ' | <span class="text-green-600 font-bold">CONFORMING</span>';
    h += '</p>';
  }
  h += '</div>';
  
  h += '<div class="bg-white rounded-lg shadow-lg p-4 mb-4"><div class="grid grid-cols-2 md:grid-cols-4 lg:grid-cols-6 gap-3 text-sm">';
  h += '<div><label class="block font-medium mb-1">ZIP</label><input id="zip" value="' + F.zip + '" maxlength="5" class="w-full p-2 border rounded"/></div>';
  h += '<div><label class="block font-medium mb-1">State</label><input value="' + F.state + '" readonly class="w-full p-2 border rounded bg-gray-50"/></div>';
  h += '<div><label class="block font-medium mb-1">County</label><input value="' + F.county + '" readonly class="w-full p-2 border rounded bg-gray-50"/></div>';
  h += '<div><label class="block font-medium mb-1">FICO</label><input id="fico" type="number" value="' + F.fico + '" class="w-full p-2 border rounded"/></div>';
  h += '<div><label class="block font-medium mb-1">Price</label><input id="price" type="number" value="' + F.price + '" class="w-full p-2 border rounded"/></div>';
  h += '<div><label class="block font-medium mb-1">LTV %</label><input id="ltv" type="number" value="' + F.ltv + '" class="w-full p-2 border rounded"/></div>';
  h += '<div><label class="block font-medium mb-1">Loan Amt</label><input id="loanAmt" type="number" value="' + F.loanAmt + '" class="w-full p-2 border rounded"/></div>';
  
  h += '<div><label class="block font-medium mb-1">Purpose</label><select id="purpose" class="w-full p-2 border rounded">';
  h += '<option value="purchase"' + (F.purpose==="purchase"?" selected":"") + '>Purchase</option>';
  h += '<option value="rateterm"' + (F.purpose==="rateterm"?" selected":"") + '>Rate/Term</option>';
  h += '<option value="cashout"' + (F.purpose==="cashout"?" selected":"") + '>Cash-Out</option></select></div>';
  
  h += '<div><label class="block font-medium mb-1">Units</label><select id="units" class="w-full p-2 border rounded">';
  h += '<option value="1"' + (F.units==="1"?" selected":"") + '>1</option>';
  h += '<option value="2"' + (F.units==="2"?" selected":"") + '>2</option>';
  h += '<option value="3"' + (F.units==="3"?" selected":"") + '>3</option>';
  h += '<option value="4"' + (F.units==="4"?" selected":"") + '>4</option></select></div>';
  
  h += '<div><label class="block font-medium mb-1">Property</label><select id="prop" class="w-full p-2 border rounded">';
  h += '<option value="sf"' + (F.prop==="sf"?" selected":"") + '>SFR</option>';
  h += '<option value="condo"' + (F.prop==="condo"?" selected":"") + '>Condo</option>';
  h += '<option value="coop"' + (F.prop==="coop"?" selected":"") + '>Co-Op</option>';
  h += '<option value="mfg"' + (F.prop==="mfg"?" selected":"") + '>Mfg</option></select></div>';
  
  h += '<div><label class="block font-medium mb-1">Occupancy</label><select id="occ" class="w-full p-2 border rounded">';
  h += '<option value="primary"' + (F.occ==="primary"?" selected":"") + '>Primary</option>';
  h += '<option value="sec"' + (F.occ==="sec"?" selected":"") + '>2nd Home</option>';
  h += '<option value="inv"' + (F.occ==="inv"?" selected":"") + '>Investment</option></select></div>';
  
  h += '<div><label class="block font-medium mb-1">Lock</label><select id="lock" class="w-full p-2 border rounded">';
  h += '<option value="15"' + (F.lock==="15"?" selected":"") + '>15</option>';
  h += '<option value="30"' + (F.lock==="30"?" selected":"") + '>30</option>';
  h += '<option value="45"' + (F.lock==="45"?" selected":"") + '>45</option>';
  h += '<option value="60"' + (F.lock==="60"?" selected":"") + '>60</option></select></div>';
  
  if (amiData) {
    var hc = isHighCostArea(F.fips);
    h += '<div class="col-span-2"><label class="block font-medium mb-1 text-indigo-700">Income</label><select id="income" class="w-full p-2 border-2 border-indigo-300 rounded">';
    h += '<option value=""' + (F.incomeLevel===""?" selected":"") + '>-- Select --</option>';
    h += '<option value="low"' + (F.incomeLevel==="low"?" selected":"") + '>$' + amiData.a80.toLocaleString() + ' (80%)</option>';
    h += '<option value="mid100"' + (F.incomeLevel==="mid100"?" selected":"") + '>$' + amiData.a80.toLocaleString() + '-$' + amiData.a.toLocaleString() + '</option>';
    if (hc) h += '<option value="mid120"' + (F.incomeLevel==="mid120"?" selected":"") + '>$' + amiData.a.toLocaleString() + '-$' + amiData.a120.toLocaleString() + '</option>';
    h += '<option value="high"' + (F.incomeLevel==="high"?" selected":"") + '>>$' + (hc?amiData.a120:amiData.a).toLocaleString() + '</option></select></div>';
  }
  
  if (F.incomeLevel === "mid100" || F.incomeLevel === "mid120") {
    h += '<div><label class="block font-medium mb-1">First-Time?</label><select id="ftb" class="w-full p-2 border rounded">';
    h += '<option value="no"' + (F.firstTimeBuyer==="no"?" selected":"") + '>No</option>';
    h += '<option value="yes"' + (F.firstTimeBuyer==="yes"?" selected":"") + '>Yes</option></select></div>';
  }
  
  h += '<div><label class="block font-medium mb-1">Comp %</label><input id="comp" type="number" step="0.125" value="' + F.comp + '" class="w-full p-2 border rounded"/></div>';
  h += '<div><label class="block font-medium mb-1">AUS</label><select id="aus" class="w-full p-2 border rounded">';
  h += '<option value="LP"' + (F.aus==="LP"?" selected":"") + '>LP</option>';
  h += '<option value="DU"' + (F.aus==="DU"?" selected":"") + '>DU</option></select></div>';
  
  h += '<div><label class="block font-medium mb-1">Category</label><select id="catFilter" class="w-full p-2 border rounded">';
  h += '<option value="all"' + (F.catFilter==="all"?" selected":"") + '>All</option>';
  h += '<option value="govt"' + (F.catFilter==="govt"?" selected":"") + '>Govt</option>';
  h += '<option value="conv"' + (F.catFilter==="conv"?" selected":"") + '>Conv</option>';
  h += '<option value="hb"' + (F.catFilter==="hb"?" selected":"") + '>HB</option>';
  h += '<option value="nqm"' + (F.catFilter==="nqm"?" selected":"") + '>NQM</option></select></div>';
  
  h += '<div><label class="block font-medium mb-1">Term</label><select id="termFilter" class="w-full p-2 border rounded">';
  h += '<option value="all"' + (F.termFilter==="all"?" selected":"") + '>All</option>';
  h += '<option value="30Y"' + (F.termFilter==="30Y"?" selected":"") + '>30Y</option>';
  h += '<option value="15Y"' + (F.termFilter==="15Y"?" selected":"") + '>15Y</option>';
  h += '<option value="ARM"' + (F.termFilter==="ARM"?" selected":"") + '>ARM</option></select></div>';
  
  h += '<div class="flex items-center pt-6"><input type="checkbox" id="escrow"' + (F.escrow?" checked":"") + ' class="mr-2"/><label>Escrow</label></div>';
  h += '<div class="flex items-center pt-6"><input type="checkbox" id="subFin"' + (F.subFin?" checked":"") + ' class="mr-2"/><label>SubFin</label></div>';
  h += '</div></div>';
  
  // Group results by product+term
  var grouped = {};
  for (var i = 0; i < filtered.length; i++) {
    var it = filtered[i];
    var key = it.p + "-" + it.t;
    if (!grouped[key]) grouped[key] = [];
    grouped[key].push(it);
  }
  
  h += '<div class="bg-white rounded-lg shadow-lg p-4"><h2 class="font-semibold mb-2">Results</h2>';
  if (jumbo) h += '<div class="bg-red-100 text-red-700 p-2 rounded mb-2">Jumbo - not available</div>';
  h += '<div class="overflow-x-auto"><table class="w-full text-sm"><thead class="bg-indigo-50"><tr>';
  h += '<th class="p-2 text-left">Product</th><th class="p-2">Term</th><th class="p-2">Rate</th><th class="p-2">Base</th><th class="p-2">Adj</th><th class="p-2">Final</th>';
  if (loanAmt) h += '<th class="p-2">Cost</th><th class="p-2">P&I</th><th class="p-2">Total</th>';
  h += '</tr></thead><tbody>';
  
  var keys = Object.keys(grouped);
  for (var k = 0; k < keys.length; k++) {
    var key = keys[k];
    var items = grouped[key];
    var firstCredit = null;
    var firstCreditIdx = -1;
    for (var i = 0; i < items.length; i++) {
      if (items[i].afterComp >= 100) { firstCredit = items[i]; firstCreditIdx = i; break; }
    }
    if (!firstCredit) { firstCredit = items[0]; firstCreditIdx = 0; }
    var it = firstCredit;
    var isBest = best && it.r === best.r && it.p === best.p && it.t === best.t;
    var hasCredit = it.afterComp >= 100;
    var cls = hasCredit ? "bg-green-50 border-b" : "border-b hover:bg-gray-50";
    if (isBest) cls = "bg-yellow-50 border-2 border-yellow-400";
    var badge = "bg-green-100 text-green-800";
    if (it.cat && it.cat.indexOf("govt") > -1) badge = "bg-blue-100 text-blue-800";
    else if (it.cat && it.cat.indexOf("hb") > -1) badge = "bg-purple-100 text-purple-800";
    else if (it.cat && it.cat.indexOf("nqm") > -1) badge = "bg-red-100 text-red-800";
    
    h += '<tr class="' + cls + ' cursor-pointer" data-grp="' + key + '">'
    h += '<td class="p-2">';
    if (items.length > 1) h += '<span class="mr-1">' + (expanded[key] ? "" : "") + '</span>';
    h += '<span class="px-2 py-1 rounded text-xs font-semibold ' + badge + '">'+ it.p + '</span>';
    if (items.length > 1) h += '<span class="ml-1 text-xs text-gray-500">(' + items.length + ' rates)</span>';
    if (isBest) h += '<span class="ml-1 px-1 bg-yellow-400 text-xs font-bold rounded">BEST</span>';
    h += '</td>';
    h += '<td class="p-2 text-center">' + it.t + '</td>';
    h += '<td class="p-2 text-center font-semibold">' + it.r.toFixed(3) + '%</td>';
    h += '<td class="p-2 text-center">' + it.base.toFixed(3) + '</td>';
    h += '<td class="p-2 text-center"><span class="' + (it.calc.adj >= 0 ? "text-green-600" : "text-red-600") + '">'+ (it.calc.adj >= 0 ? "+" : "") + it.calc.adj.toFixed(3) + '</span></td>';
    h += '<td class="p-2 text-center font-bold"><span class="' + (it.afterComp >= 100 ? "text-green-600" : "text-red-600") + '">'+ it.afterComp.toFixed(3) + '</span></td>';
    if (loanAmt) {
      h += '<td class="p-2 text-center"><span class="' + (it.disc < 0 ? "text-green-600" : "text-red-600") + '">'+ (it.disc < 0 ? "+" : "-") + '$' + Math.abs(it.disc).toLocaleString(undefined,{maximumFractionDigits:0}) + '</span></td>';
      h += '<td class="p-2 text-center">$' + it.mo.toLocaleString(undefined,{maximumFractionDigits:0}) + '</td>';
      h += '<td class="p-2 text-center font-bold">$' + it.total.toLocaleString(undefined,{maximumFractionDigits:0}) + '</td>';
    }
    h += '</tr>';
    
    if (expanded[key]) {
      for (var j = 0; j < items.length; j++) {
        if (j === firstCreditIdx) continue;
        var sub = items[j];
        var subHasCredit = sub.afterComp >= 100;
        var subCls = subHasCredit ? "bg-green-50 border-b" : "bg-gray-50 border-b";
        h += '<tr class="' + subCls + '">'
        h += '<td class="p-2 pl-8 text-xs text-gray-600"></td>';
        h += '<td class="p-2 text-center">' + sub.t + '</td>';
        h += '<td class="p-2 text-center">' + sub.r.toFixed(3) + '%</td>';
        h += '<td class="p-2 text-center">' + sub.base.toFixed(3) + '</td>';
        h += '<td class="p-2 text-center"><span class="' + (sub.calc.adj >= 0 ? "text-green-600" : "text-red-600") + '">'+ (sub.calc.adj >= 0 ? "+" : "") + sub.calc.adj.toFixed(3) + '</span></td>';
        h += '<td class="p-2 text-center"><span class="' + (sub.afterComp >= 100 ? "text-green-600" : "text-red-600") + '">'+ sub.afterComp.toFixed(3) + '</span></td>';
        if (loanAmt) {
          h += '<td class="p-2 text-center"><span class="' + (sub.disc < 0 ? "text-green-600" : "text-red-600") + '">'+ (sub.disc < 0 ? "+" : "-") + '$' + Math.abs(sub.disc).toLocaleString(undefined,{maximumFractionDigits:0}) + '</span></td>';
          h += '<td class="p-2 text-center">$' + sub.mo.toLocaleString(undefined,{maximumFractionDigits:0}) + '</td>';
          h += '<td class="p-2 text-center">$' + sub.total.toLocaleString(undefined,{maximumFractionDigits:0}) + '</td>';
        }
        h += '</tr>';
      }
    }
  }
  h += '</tbody></table></div></div>';
  h += '<div class="mt-4 bg-indigo-600 text-white rounded-lg p-3 text-center text-sm">TPO Go | (860) 676-8003</div>';
  
  appEl.innerHTML = h;
  attachEvents();
}

function attachEvents() {
  var z = document.getElementById("zip");
  if (z) { z.onblur = function() { if (this.value !== F.zip) doZip(this.value); }; z.onkeypress = function(e) { if (e.key === "Enter") doZip(this.value); }; }
  
  var fi = document.getElementById("fico");
  if (fi) { fi.onblur = function() { if (this.value !== F.fico) { F.fico = this.value; render(); } }; fi.onkeypress = function(e) { if (e.key === "Enter") { F.fico = this.value; render(); } }; }
  
  var pr = document.getElementById("price");
  if (pr) { pr.onblur = function() { if (this.value !== F.price) doPrice(this.value); }; pr.onkeypress = function(e) { if (e.key === "Enter") doPrice(this.value); }; }
  
  var lt = document.getElementById("ltv");
  if (lt) { lt.onblur = function() { if (this.value !== F.ltv) doLtv(this.value); }; lt.onkeypress = function(e) { if (e.key === "Enter") doLtv(this.value); }; }
  
  var la = document.getElementById("loanAmt");
  if (la) { la.onblur = function() { if (this.value !== String(F.loanAmt)) { F.loanAmt = this.value; if (F.price && this.value) { F.ltv = Math.round(parseFloat(this.value) / parseFloat(F.price) * 10000) / 100; } render(); } }; la.onkeypress = function(e) { if (e.key === "Enter") { F.loanAmt = this.value; if (F.price && this.value) { F.ltv = Math.round(parseFloat(this.value) / parseFloat(F.price) * 10000) / 100; } render(); } }; }
  
  var co = document.getElementById("comp");
  if (co) { co.onblur = function() { var v = parseFloat(this.value) || 0; if (v !== F.comp) { F.comp = v; render(); } }; }
  
  var pu = document.getElementById("purpose"); if (pu) pu.onchange = function() { F.purpose = this.value; render(); };
  var un = document.getElementById("units"); if (un) un.onchange = function() { F.units = this.value; render(); };
  var pp = document.getElementById("prop"); if (pp) pp.onchange = function() { F.prop = this.value; render(); };
  var oc = document.getElementById("occ"); if (oc) oc.onchange = function() { F.occ = this.value; render(); };
  var lk = document.getElementById("lock"); if (lk) lk.onchange = function() { F.lock = this.value; render(); };
  var inc = document.getElementById("income"); if (inc) inc.onchange = function() { F.incomeLevel = this.value; F.firstTimeBuyer = "no"; render(); };
  var ftb = document.getElementById("ftb"); if (ftb) ftb.onchange = function() { F.firstTimeBuyer = this.value; render(); };
  var au = document.getElementById("aus"); if (au) au.onchange = function() { F.aus = this.value; render(); };
  var cf = document.getElementById("catFilter"); if (cf) cf.onchange = function() { F.catFilter = this.value; render(); };
  var tf = document.getElementById("termFilter"); if (tf) tf.onchange = function() { F.termFilter = this.value; render(); };
  var es = document.getElementById("escrow"); if (es) es.onchange = function() { F.escrow = this.checked; render(); };
  var sf = document.getElementById("subFin"); if (sf) sf.onchange = function() { F.subFin = this.checked; render(); };
  
  var rows = document.querySelectorAll("tr[data-grp]");
  for (var i = 0; i < rows.length; i++) {
    rows[i].onclick = function() {
      var grp = this.getAttribute("data-grp");
      expanded[grp] = !expanded[grp];
      render();
    };
  }
}

render();
})();
</script></body></html>
